import React from 'react';
import Square from './Square';
import './Row.css';

function Row(props) {
    let id = -1;
const squares = props.squares.map((square) => { id++; return <Square key={id} color={square === 1 ? 'white' : 'black'} /> });
    return (
        <div className="Row">
            {squares}
        </div>
    );
}

export default Row;
